import ReactDOM from 'react-dom';
import React from 'react';

const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3'>
                {'This will detect faces in your images'}
            </p>
            <div className='center'>
                <input className='f4 pr1 w-70 center' type='tex' />
                <button w-30 grow f1 link ph3 pv2 dib white bg-lightorange>Detect</button>
            </div>
        </div>
    );
};

ReactDOM.render(<ImageLinkForm />, document.getElementById('root'));

export default ImageLinkForm;
